import React from 'react';


class AnalysisPage extends React.Component {
    state = {
        fileToUpload: undefined,
    };

    onUploadButtonClick = (event) => {
        console.log(event.target.files);
    };

    render() {
        return (
            <div className="analyze">
                <div className="radio-group">
                    <div className="radio">
                        <input
                            type="radio"
                            value='mode1'
                            onChange={this.onModeChange}
                            checked={this.state.search_mode === 'mode1'}
                        />
                        <span>Динамический анализ</span>
                    </div>
                    <div className="radio">
                        <input
                            type="radio"
                            value='mode2'
                            onChange={this.onModeChange}
                            checked={this.state.search_mode === 'mode2'}
                        />
                        <span>Статический анализ</span>
                    </div>
                </div>

                <div className="analyze__upload">
                    <input
                        ref="fileInput"
                        onChange={this.handleFileUpload}
                        type="file"
                        style={{ display: "none" }}
                        multiple={true}
                    />
                    <button onClick={() => this.refs.fileInput.click()}>Upload File</button>
                </div>
            </div>
        );
    }
};

export default AnalysisPage;
